#Longest Palindromic Sequence
"""

def longest_palindromic_subsequence(X):
    n = len(X)

    # Initialize memoization table
    memo = [[-1] * n for _ in range(n)]

    # Helper function to find longest palindromic subsequence
    def helper(start, end):
        if start > end:
            return 0
        if start == end:
            return 1

        if memo[start][end] != -1:
            return memo[start][end]

        if X[start] == X[end]:
            memo[start][end] = 2 + helper(start+1, end-1)
        else:
            memo[start][end] = max(helper(start+1, end), helper(start, end-1))

        return memo[start][end]

    return helper(0, n-1)

# Example usage
X = "character"
print("Longest palindromic subsequence:", longest_palindromic_subsequence(X))

"""#Optimal Binary Search Trees"""

def optimal_bst(keys, freq):
    n = len(keys)

    # Initialize memoization table
    memo = [[0] * n for _ in range(n)]

    # Helper function to calculate optimal BST cost
    def helper(start, end):
        if start > end:
            return 0

        if memo[start][end] != 0:
            return memo[start][end]

        min_cost = float('inf')
        for r in range(start, end+1):
            cost = helper(start, r-1) + helper(r+1, end)
            for i in range(start, end+1):
                cost += freq[i]
            if cost < min_cost:
                min_cost = cost

        memo[start][end] = min_cost
        return min_cost

    return helper(0, n-1)

# Example usage
keys = [10, 12, 20]
freq = [34, 8, 50]
print("Optimal BST cost:", optimal_bst(keys, freq))

"""#Alternating Coin Game"""

def alternating_coin_game(coins):
    n = len(coins)

    # Initialize memoization table
    memo = [[0] * n for _ in range(n)]

    # Helper function to calculate the maximum value that can be won
    def helper(i, j):
        if i == j:
            return coins[i]
        if i + 1 == j:
            return max(coins[i], coins[j])

        if memo[i][j] != 0:
            return memo[i][j]

        # If it's our turn, we pick the maximum of the two options
        pick_left = min(helper(i + 1, j - 1), helper(i + 2, j)) + coins[i]
        pick_right = min(helper(i, j - 2), helper(i + 1, j - 1)) + coins[j]

        memo[i][j] = max(pick_left, pick_right)
        return memo[i][j]

    return helper(0, n - 1)

# Example usage
coins = [8, 15, 3, 7]
print("Maximum value that can be won:", alternating_coin_game(coins))